function jn2score(jn){
    for(i in ifdata){
        if(ifdata[i]['name'] == jn){
            return ifdata[i]['IF'];
        }
    }
    return 0;
}

function jn2Q(jn){
    for(i in ifdata){
        if(ifdata[i]['name'] == jn){
            return ifdata[i]['Q'];
        }
    }
    return '-';
}
function jn2B(jn){
    for(i in ifdata){
        if(ifdata[i]['name'] == jn){
            return ifdata[i]['B'];
        }
    }
    return '-';
}

(function() {
    $('.search-page > .inner-wrap').css('width', '95%');
    $('.static-filters').css('width', '20%');
    $('.search-results').css('width', '80%');
    'use strict';
    var count_class={'>20':'c1', '10-20':'c2', '5-10':'c3', '0-5':'c4', 'unknown': 'c5'};
    var count={'>20':0, '10-20':0, '5-10':0, '0-5':0, 'unknown': 0};
    var count_color={'>20':'#F66', '10-20':'#C99', '5-10':'#CC3', '0-5':'#CCC', 'unknown': 'gray'};
    var count_chose={'>20':1, '10-20':1, '5-10':1, '0-5':1, 'unknown':1};

    function loadIF(){
        $('.full-journal-citation').each(function(){
            if($(this).text() == ''){
                return;
            }
            if($(this).is('.addIF')){
                return;
            }
            $(this).addClass('addIF');
            var citestr = $(this).text();
            var jname = citestr.split('. ')[0];
            var jif = 0;

            jif = jn2score(jname);
            var jq = jn2B(jname);
            var timestr = citestr.split('. ')[1];
            timestr = timestr.replace(/[;\.\:].*/,'');
            var newcite = [jif, citestr.split('. ')[0], jq, timestr, citestr.split('. ').slice(2)];
            var otherformat = 'color:#FFF; padding:3px;';
            var color='gray';
            $(this).html(newcite.map((x,i)=>{
                if(i == 0){
                    var kk;
                    if(x > 20){
                        kk = '>20'
                    }else if(x > 10){
                        kk = '10-20';
                    }else if(x > 5){
                        kk='5-10';
                    }else if(x > 0){
                        kk='0-5';
                    }else{
                        kk='unknown';
                        x=kk;
                    }
                    color=count_color[kk];
                    count[kk]+=1;
                    return `<span class='${count_class[kk]}' style="background-color:${color}; ${otherformat}">${x} | <a href="javascript:void(0)" class="filterJ"  style="color:#FFF;">${newcite[i+1]}</a> | ${newcite[i+2]}</span>`;
                }else if(i==1){
                    return;
                }else if(i==2){
                    return;
                }else if(i==3){
                    return `<span style='font-weight: bold;color: #000;text-decoration: underline;'>${x}</span>`;
                }else{
                    return `<span>${x}</span>`;
                }
            }).join(' '));
            var newtitle = `<span style="text-decoration: underline;">` + $(this).parent().prev().html() + '</span>';
            $(this).parent().prev().before(newtitle);
            $(this).parent().prev().html('link');
            $(this).parent().prev().attr('target', '_blank');
        });
        var stat_str = Object.keys(count).map((x)=>{
            return `<a cid="${x}" style="
            background-color:${count_color[x]};
            padding:5px;
            margin-right:1px;
            width:${95/Object.keys(count).length}%;
            float: left;
            text-align: center;
            color: #FFF;
            font-weight: normal;
            cursor: pointer;
            border-radius: 10px;
        ">${x}:${count[x]}</a>`;
        }).join('');
        $('.search-results').prepend(`<div class="ifbox">${stat_str}<div style="clear:both;"></div></div>`);

        if($('.user-filters .jlist').length == 0){
            $('.user-filters').append('<div class="jlist"></div>');
        }

        function updateJlist(){
            var visibleElements = $('.full-docsum:visible a.filterJ');
            var textCounts = {};

            visibleElements.each(function() {
                var text = $(this).text().trim();
                textCounts[text] = (textCounts[text] || 0) + 1;
            });

            //  IF 
            var sortedTextCounts = Object.entries(textCounts)
            .sort((a, b) => {
                // 
                if (b[1] !== a[1]) {
                    return b[1] - a[1];
                }
                //  IF 
                var ifA = jn2score(a[0]); //  jn2score  IF 
                var ifB = jn2score(b[0]);
                return ifB - ifA;
            });

            // 
            var table = $('<table style="margin:0px;">').addClass('sorted-table');
            var headerRow = $('<tr>').append(
                $('<th style="padding: 0px 10px; background-color: #E7F4E4;">').text('Journal'),
                $('<th style="padding: 0px 10px; background-color: #E7F4E4;">').text('Co'),
                $('<th style="padding: 0px 10px; background-color: #E7F4E4;">').text('IF'),
                $('<th style="padding: 0px 10px; background-color: #E7F4E4;">').text('CAS')
            );
            table.append(headerRow);

            // 
            var numRowsToShow = Math.min(20, sortedTextCounts.length);
            for (var i = 0; i < numRowsToShow; i++) {
                var entry = sortedTextCounts[i];
                var text = entry[0];
                var count = entry[1];
                var ifValue = jn2score(text); //  jn2score  IF 
                var dataRow = $('<tr>').append(
                    $('<td style="padding: 0px 10px;">').text(text),
                    $('<td style="padding: 0px 10px;">').text(count),
                    $('<td style="padding: 0px 10px;">').text(ifValue),
                    $('<td style="padding: 0px 10px;">').text(jn2B(text)),
                );
                table.append(dataRow);
            }

            $('.jlist').html('');
            var toggleButton = $('<a>').text('Journal list');
            $('.jlist').append(toggleButton);
            $('.jlist').append(table);

            //table.hide();
            toggleButton.click(function() {
                table.toggle();
            });
        }

        function updateSelect(){
            $('.ifbox a').each(function(){
                var x = $(this).attr('cid');
                var borderStyle;
                if(count_chose[x] == 1){
                    borderStyle = '3px solid #363';
                }else{
                    borderStyle = '3px solid #FFF';
                }
                $(this).css('border', borderStyle);
            });
            $('.full-journal-citation').parent().parent().parent().parent().css('display', 'none');
            var fcid = Object.keys(count_chose).filter((i)=>{return count_chose[i]==1});
            for(var i in fcid){
                $(`.full-journal-citation .${count_class[fcid[i]]}`).parent().parent().parent().parent().parent().css('display', 'block');
            }
            updateJlist();
        }
        updateSelect();
        $('[cid]').click(function(event){
            var cid = $(this).attr('cid');
            if(Object.keys(count_chose).filter((i)=>{return count_chose[i]==0}).length == 0){
                var fcid = Object.keys(count_chose)
                for(var i in fcid){
                    count_chose[fcid[i]] = 0;
                }
            }
            if(count_chose[cid] == 1){
                count_chose[cid] = 0;
            }else{
                count_chose[cid] = 1;
            }
            updateSelect();
        });
        // abstract page
        var jname = $('#full-view-journal-trigger').text();
        jname = jname.replace(/^\s+/g,'');
        jname = jname.replace(/\s+$/g,'');
        jname = jname.replace(/\s+/g,' ');
        var jif = 0;
        jif = jn2score(jname);

        var kk;
        if(jif > 20){
            kk = '>20'
        }else if(jif > 10){
            kk = '10-20';
        }else if(jif > 5){
            kk='5-10';
        }else if(jif > 0){
            kk='0-5';
        }else{
            kk='unknown';
        }
        var color=count_color[kk];
        var otherformat = 'color:#FFF; padding:3px;';
        var newstr = `<span style="background-color:${color}; ${otherformat}">${jif} | ${jname}</span>`;
        $('#full-view-journal-trigger').html(newstr);
    }
    loadIF();
    // load new page
    $('.load-button').click(function(){
        $('.jlist').html('');
        var old_len = $('.full-journal-citation').length;
        function timm(){
            var new_len = $('.full-journal-citation').length;
            if(new_len > old_len){
                $('.ifbox').remove();
                loadIF();
                return;
            }
            setTimeout(timm,1000);
        }
        timm();
    });

    $('.filterJ').click(function(){
        var jname = $(this).text();
        var oldname = $('#id_term').val();
        oldname = oldname.replace(/(.*)\".*?"\[Journal\]/,"$1");
        oldname = oldname + ` "${jname}"[Journal]`;
        $('#id_term').val(oldname);
    });

    // });

})();
